import "../../assets/sass/sass-components/container-component/background-container.scss";

import React from "react";

function BackgroundContainer() {
  return (
    <div className="backgrounds">
      <div id="background-item1"></div>
      <div id="background-item2"></div>
    </div>
  );
}

export default BackgroundContainer;
